#![feature(const_generics)]
#![feature(const_fn)]
use core::marker::PhantomData; struct Texture<T: Default, const SET: u32, const SLOT: u32> { d: PhantomData<T>
} impl<T: Default, const SET: u32, const SLOT: u32> Texture<T, SET, SLOT> { const fn new() -> Self { Self { d: PhantomData } } fn sample(&self, _u: f32, _v: f32) -> T { T::default() }
} This is a more traditional example that's closer to how HLSL or GLSL would do bindings, they have a few generic parameters and it relies on const_generic to function. If we mirror this in existing Rust syntax we'll get something like this: static ALBEDO : Texture::<f32, 0, 0> = Texture::new();
static NORMAL_MAP : Texture::<f32, 0, 1> = Texture::new();
static SMOOTHNESS : Texture::<f32, 0, 2> = Texture::new();
static LIGHTMAP : Texture::<f32, 0, 3> = Texture::new(); fn main() { // functions can access the globals directly let mut T = brdf(); T += gi();
} This seems to have a few downsides: All caps for the variable/buffer name. Right now a constructor call is required, and it should be const. Need to ensure no overlap between sets & slots. In big code-bases, the dependencies on shaders become very blurred and one needs to inveriable figure out which bindings don't get DCE'd, and more importantly which bindings are actually being used. If you're using a crate authored by a 3rd-party, it quickly becomes non-obvious which resources need to be bound. Unclear which downstream call-sites end up requiring more bindings to your SPIR-V blob. And a few upsides: Globals can be accessed anywhere in the program, easily. Alternative would be to remove the const_generic parameters potentially by moving them into the constructor. static ALBEDO : Texture::<f32> = Texture::new(0, 0);
static NORMAL_MAP : Texture::<f32> = Texture::new(0, 1);
static SMOOTHNESS : Texture::<f32> = Texture::new(0, 2);
static LIGHTMAP : Texture::<f32> = Texture::new(0, 3); This would make it easier to pass textures to functions (even if they're in different slots) because you'd get something like this: fn some_system(tex: &Texture::<f32>) { let v = tex.sample(0.0, 0.0);
} Instead of this, which would tightly couple the whole downstream system to have a texture bound to a specific set and slot. This would make changing the bindings later on a nightmare, and wouldn't allow you to conditionally invoke some_system with textures bound to different locations. fn some_system(tex: &Texture::<f32, 0, 0>) { let v = tex.sample(0.0, 0.0);
}

