Most compute-only languages tend to prefer this along with positional binding. This makes "invoking a shader" look much more like a function call and uses existing and familiar semantics. fn main(albedo: Texture::<f32>, normal_map: Texture::<f32>, smoothness: Texture::<f32>, lightmap: Texture<f32>) { let mut T = brdf(&albedo, &normal_map, &smoothness); T += gi(&lightmap);
} Doing this straight up has a few downsides: Big kernels/shader can have lots of buffers and textures bound making this list potentially large. Need to pass down all bindings all the way to leaf-node systems. Some upsides: No clashes for sets/slots since the language takes care of this. It's clear from the get-go which bindings are being used. A much nicer and more ergonomic approach would be to store texture bindings in structs: struct ShadingInputs { albedo: Texture::<f32>, normal_map: Texture::<f32>, smoothness: Texture::<f32>,
} struct IndirectLighting { lightmap: Texture<f32>,
} fn main(inputs: &ShadingInputs, indirect_lighting: &IndirectLighting) { let mut T = brdf(&inputs); T += gi(&indirect_lighting);
}

