A SPIR-V shader must declare where uniform variables are located with explicit indices that match up with CPU-side code. This can be done with the descriptor_set and binding attributes. Note that descriptor_set = 0 is reserved for future use, and cannot be used. Example: #[spirv(fragment)]
fn main( #[spirv(descriptor_set = 2, binding = 5)] mut var: Uniform<Vec4>,
) { } Both descriptor_set and binding take an integer argument that specifies the uniform's index.

